import React from "react";
import "../mainWindow/window.css";
import NewsBlock from "../rightBar/newsContent";

const News = (props) => {
  return (
    <div className="NewsMain">
      <div className="headNews">
        <h1>Новости</h1>
      </div>
      <NewsBlock news={props.Advertising.news}></NewsBlock>
    </div>
  );
};

export default News;
